            },
            goBack: function() {
                this.$emit('to-page', 'start');
            },
            pulseStart: function(e) {
                if (e.target.classList.contains('fadeIn')) {
                    e.target.classList.remove('fadeIn');
                }
                e.target.classList.add('pulse');
                e.target.classList.add('infinite');
                e.target.classList.add('animated');
            },
            pulseEnd: function(e) {
                e.target.classList.remove('animated');
            },
        },
        mounted: function() {
            var stagePanels = document.getElementsByClassName("stage-panel");
            for (var i = 0; i < stagePanels.length; i++) {
                (function() {
                    var stageIndicators = document.getElementsByClassName("stage-indicator");
                    var panelExamplePanel = stagePanels[i].querySelector(".ms-Panel");
                    for (var j = 0; j < stageIndicators.length; j++) {
                        stageIndicators[j].addEventListener("click", function(i) {
                            new fabric['Panel'](panelExamplePanel);
	                        // Intiate fadeInLeft animations
                            var fades = panelExamplePanel.querySelector(".fadeInLeft");
	                        if (fades)
